import React from 'react';
import styled from 'styled-components';

const Styles = styled.div`


    display: grid;
    justify-content: center;
    margin-top:5%;
    left:50%;


.hey{
	font:4vw 'Permanent Marker';
	line-height:1em;
	background-color: #10fdd7;
  	color: black; 
  	font-weight: bold;
  	width: 100%;
  	text-align: center;
  	position: relative;
  	padding: 5px 10px;
  	left: 45%;
  	transform: translate(-50%, -50%);
  	mix-blend-mode: screen;
}
.name{
	font:9vw 'Gochi Hand';
	position:relative;
	text-align:center;
	display:inline-block;
	padding:5px 10px;
}
.btm{
	 font:2vw 'Architects Daughter';
	 background-color:teal;
	 padding:0 3em;
	 text-align:center;
}
.how{
	font:2em 'Lobster';
	text-align:center;
}
.am{
	font:3vw 'Permanent Marker';
	color:cyan;
}
@media screen and (max-width: 600px) {
	margin-top:20%;
	left:42vh;
  .btm {
    font-size:0.9em;
    padding:0 0.5em;
  }
  .hey{margin-bottom:5%;}
  .how{font-size:1.5em;}
  .am{font-size:5vw} 
}
`;

function Home() {
	return(
		<Styles>
		<div className='hey'>HELLO!</div>
		<span className='how'>How's it going?</span>
		<span className='am'>I am</span>
		<span className='name'>Bimarsha Khanal.</span>
		<div class='btm'>
		-----Computer Engineering | Technophile | Autodidact-----
		</div>

		</Styles>

		);
}

export default Home;
